import React from "react";

function CompareButton({ item }) {
  const handleClick = () => {
    window.location.href = `/lists/compare`;
  };

  return (
    <div className="compare-button-container">
      <div className='compare-button' onClick={handleClick}> {item.name }</div>
    </div>  
  );
}

export default CompareButton;
